svg.script:
    frame = 20;
	direction = 1;
    function doOneStep() { 
	background = document.getElementById("back");
	background.setAttribute("opacity", frame/100);
	frame += (direction)? 1 : -1;
	console.log(frame);
	if ((frame <= 150) && (frame >= 20)){
	    setTimeout(doOneStep, 40);
    } else {
	direction = 1 - direction;
	console.log(direction);
	setTimeout(doOneStep, 40);
	}
	}
    doOneStep();
